import React ,{useEffect, useState} from 'react'
import './search.css'
function Search() {
  return (
    <div className='search-body'>
     <div class="input-box">
      {/* <i class="uil uil-search"></i> */}
      <input type="text" placeholder="Search here..." />
      <button class="button">Search</button>
    </div>
    </div>
  );
}

export default Search;
